import React, {useState, useEffect} from 'react'
import axiosWithAuth from '../axiosWithAuth'
import OperatorDetails from './OperatorDetails'
import Operatorheader from '../Headers/Operatorheader'
import { OperatorBody, OperatorText } from '../../styled-components'

export default function OperatorDashboard(match) {
    console.log(match)
    const [operators, setOperators] = useState([])

window.localStorage.getItem('token')


    useEffect(()=>{
          axiosWithAuth().get('/api/ops')
          .then(res =>{
            console.log(res.data.users)
            setOperators(res.data.users)
          })
          .catch(err =>{ console.log(err, 'No data coming in!')})
    },[])
    




    return (
        <>
        <Operatorheader/>
        <OperatorBody>
        <h1>Welcome to the Operator Dashboard</h1>
        <h2>Current Active Operators</h2>
        <OperatorText>
            </OperatorText>
            {operators.map(item =>{
                return(
                    <OperatorDetails
                    key={item.id}
                    id={item.id}
                    userName={item.username}
                    />
                )
            })}
            </OperatorBody>
        </>

    )
}
